window.bookSummaryJSON = "<p>My sin? Falling in love.</p> <p>People say \"Go to Hell\" like it's a place. It is. But it's also a state of existence, one with which I'm intimately familiar.</p> <p>What else would you expect for one of the damned, though? You know, those of us who’ve been cast out. The Fallen Ones.</p> <p>We’re all doomed to an existence of absolute suffering for daring to piss off the Big Guy.</p> <p>So what’s my hell?</p> <p>Knowing what true love is, and being forced to spend the rest of my immortal life without it.</p> <p><i>My Soul to Take </i>is a stand-alone forbidden-love-meets-fated-mates romance that explores how far a fallen angel will go for a second chance to save her soulmate. <br> <br> Content note: This book deals with terminal illness. Please check the author's website for all other content and trigger warnings.</p>"; 
